/*
Implement strStr().

Returns the index of the first occurrence of needle in haystack, or -1 if needle is not part of haystack.

*/

#include <fstream>
#include <iostream>
#include <string>
#include <vector> 
#include <list>
#include <sstream>
#include <iterator>
#include <map> 
#include <iomanip>
#include <utility> 
#include <stdio.h>
#include <stdlib.h>
#include <unistd.h>
#include <ctype.h>
#include <limits>
#include <queue>
#include <math.h>
#include <stack>

using namespace std;

class Solution {
private:
    int strlength(char *ptr){
    	int count=0;
        while (*ptr!='\0'){
        	ptr++;
        	count++;
        }
        return count;
    }
public:
    int strStr(char *haystack, char *needle) {    	
    	int hay_leng=strlength(haystack);
    	int needle_leng=strlength(needle);

    	if (needle_leng==0) return 0;
    	else if (hay_leng==0) return -1;
    	
    	for (int i=0; i<=hay_leng- needle_leng; i++){
    		int j=0;
    		for (; j<needle_leng; j++){
    			if ( *(haystack+i+j) != *(needle+j) ) break;
    		}
    		if (j==needle_leng) return i;
    	}
    	return -1;
    	
    }
};




int main(){  
  Solution sol;   
  char* str1= "";
  char* str2= "" ;
  
  cout<<sol.strStr(str1,str2)<<endl;

}










